import React from 'react';

const PrintQuote = (props) => {
    return (
        <div className="printQuote">
            {props.quotes.map((data,index)=>{
                <li key={`author- ${data.author}`}>{data.text}</li>
            })
        }
        </div>
    )
}

export default PrintQuote;
